  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115585 includes chemical,
  discrete sample, physical and profile data collected from PELAGIA in the Bay of
  Biscay and North Atlantic Ocean from 1996-06-18 to 1996-06-18 and retrieved during
  cruise CARINA/64PE19960618. These data include DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE and WATER TEMPERATURE. The instruments
  used to collect these data include CTD and bottle. These data were collected by
  H.M. van Aken of Netherlands Institute for Sea Research as part of the CARINA/64PE19960618,
  WOCE AR12e data set.nnThe World Ocean Circulation Experiment (WOCE) was a major
  component of the World Climate Research Program with the overall goal of better
  understanding the ocean's role in climate and climatic changes resulting from both
  natural and anthropogenic causes. The CO2 survey took advantage of the sampling
  opportunities provided by the WOCE Hydrographic Program (WHP) cruises during this
  period between 1990 and 1998. The final collection covers approximately 23,000 stations
  from 94 WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
